DROP TABLE IF EXISTS `tbl_repair_register`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `tbl_repair_register` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `repair_date` datetime NOT NULL,
  `repair_code` varchar(20) NOT NULL,
  `repair_spare_code` varchar(20) NOT NULL,
  `repair_type` varchar(100) NOT NULL,
  `repair_breakdown_start` datetime NOT NULL,
  `repair_breakdown_stop` datetime NOT NULL,
  `repair_breakdown_time` varchar(50) NOT NULL,
  `repair_breakdown_time_h` int(5) NOT NULL,
  `repair_breakdown_time_m` int(5) NOT NULL,
  `repair_breakdown_time_s` int(5) NOT NULL,
  `repair_type_by` varchar(5) NOT NULL,
  `repair_symptom` text NOT NULL,
  `repair_symptom_pic` varchar(70) NOT NULL,
  `repair_informer` varchar(50) NOT NULL,
  `assigner` varchar(50) NOT NULL,
  `assign_date` datetime NOT NULL,
  `desired_date` date NOT NULL COMMENT 'วันที่ต้องการใช้งาน',
  `tech_group` varchar(150) NOT NULL,
  `tech_leader` varchar(100) NOT NULL,
  `tech_2` varchar(100) NOT NULL,
  `tech_3` varchar(100) NOT NULL,
  `tech_4` varchar(100) NOT NULL,
  `tech_5` varchar(100) NOT NULL,
  `tech_accept` varchar(100) NOT NULL,
  `tech_accept_date` datetime NOT NULL,
  `external_company` varchar(255) NOT NULL,
  `external_tech_leader` varchar(255) NOT NULL,
  `external_phone` varchar(70) NOT NULL,
  `sparepart_use` varchar(255) NOT NULL,
  `wait_sparepart` varchar(255) NOT NULL,
  `pr_no` varchar(30) NOT NULL,
  `repair_detail_pic` varchar(70) NOT NULL,
  `repair_detail` text NOT NULL,
  `working_day` datetime NOT NULL,
  `working_day_stop` datetime NOT NULL,
  `dispatcher` varchar(50) NOT NULL COMMENT 'ผู้ส่งงาน',
  `repair_finished_date` datetime NOT NULL,
  `inspector` varchar(50) NOT NULL COMMENT 'ผู้ตรวจงาน',
  `close_job_date` datetime NOT NULL,
  `note` text NOT NULL,
  `last_update` datetime NOT NULL,
  `status` varchar(20) NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `repair_code` (`repair_code`)
) ENGINE=InnoDB AUTO_INCREMENT=1440 DEFAULT CHARSET=utf8mb4 COMMENT='ตารางแจ้งซ่อม';
