INSERT INTO `tbl_users_level` VALUES (1,'AD','administrator','ผู้ดูแลระบบ','ระดับผู้ดูแลระบบ สามารถจัดการทุกอย่างในระบบได้ เช่น สร้างผู้ใช้งาน กำหนดสิทธิ์การใช้งาน ยกเลิกผู้ใช้งาน เป็นต้น','ALL','Active'),(2,'IF','informer','ผู้แจ้งซ่อม','สามารถทำการแจ้งซ่อม ติดตามงานซ่อม และปิดงานซ่อม','PM','Active'),(3,'PM','assignment','PM','สามารถทำการมอบหมายงานช่างผู้รับผิดชอบงานซ่อมนั้นๆ ติดตามงานซ่อม เรียกดูรายงานซ่อม จัดการข้อมูลเครื่องจักร สร้าง แก้ไข, จัดการข้อมูลประเภทเครื่องจักร สร้าง แก้ไข','PM','Active'),(4,'TECH','technician','ช่างซ่อม','สามารถเรียกดูงานซ่อมที่มีการแจ้ง และงานที่ได้รับมอบหมาย บันทึกรายละเอียดการซ่อม ','PM','Active'),(5,'PR','purchase','จัดซื้อทั่วไป','เปิด PO, update สถานะ รอเปรียบเทียบ รออนุมัติ ปิดงาน ','PR','Active'),(6,'ST','store','สโตร์','เปิด PR, update สถานะ รับเข้า ค้างส่ง ','PR','Active'),(7,'US','user','ผู้ใช้งานทั่วไป','ใช้งานทั่วไป ไม่สามารถจัดการค่าพื้นฐานได้','HR','Active');
